<script type="text/javascript">
//<![CDATA[
jQuery(document).ready(function($) {
	$('a[rel].switch').click(function() {
		var $this = $(this);
		var $section = $('#'+$this.attr('rel'));
		if(!$section) return false;

		$this.hasClass('isHidden') ? $section.show() : $section.hide();
		$this.toggleClass('isHidden');
		return false;
	})
	.each(function() { // initialization
		var $this = $(this);
		var $section = $('#'+$this.attr('rel'));
		if(!$section) return false;

		$this.hasClass('isHidden') ? $section.hide() : $section.show();
	})
	.each(function() {
		$(this).parent().hover(
			function() {
				$(this).append($('<a title="top"> ...&uarr;</a>')
				.attr('href', '#')
				.css('text-decoration', 'none'));
			},
			function() {
				$(this).find("a:last").remove();
			}
		);
	});
});

jQuery(document).ready(function($) {
	$('._bookmark').click(function() {
		var eid = $(this).attr('href'), $h = $(eid), blockName = $h.attr('rel');
		$('#'+blockName).show();
		$h.removeClass('isHidden');
	});
});
//]]>
</script>

